DAEMON Tools Pro v4.10.0218.rar
DAEMON Tools Pro build 218 is released on 8-th September 2007
DAEMON  Tools Pro is CD &amp; DVD emulation software which allows users to make CD/DVD disc images, create a virtual CD/DVD drives and play CDs &amp; DVDs without  the need  for the physical disc.

Release Notes:
Bugs fixed:
- Image convertion bug for images with bad sectors; 
- Some minor bugs;
Known issues:
- DTPro Shell extensions do not appear on x64 platforms;
- IDE Adapter is not supported on Windows XP (x64) and Windows Server 2003 (Advanced Edition);
Please note:
- an Internet connection is necessary to use DT Pro and DT Pro is activated via internet
